function About() {
    return (
      <section>
        <h2 className="text-xl font-semibold mb-2">About Me</h2>
        <p>
          I am a passionate frontend developer with a love for clean UI,
          reusable components, and delightful user experiences.
        </p>
      </section>
    );
  }
  
  export default About;
